import React from 'react';
import Header from './Header';
import './App.js';

function App() {
  return (
    <div className="App">
      <div className="stars"></div>
      <Header />

      {/* Sección "Sobre mí" dividida en 2 cuadros */}
      <section id="about" className="section">
        <h2>Sobre mí</h2>
        <div className="about-grid">
          <div className="about-box" onClick={() => console.log('Experiencia laboral')}>
            <h3>Experiencia Laboral</h3>
            <p>Detalles de tu experiencia...</p>
          </div>
          <div className="about-box" onClick={() => console.log('Formación académica')}>
            <h3>Formación Académica</h3>
            <p>Detalles de tu formación...</p>
          </div>
        </div>
      </section>

      {/* Sección "Proyectos" con cuadro interactivo */}
      <section id="projects" className="section">
        <h2>Proyectos</h2>
        <div className="project-box">
          <img src="/proyecto-ejemplo.jpg" alt="Proyecto" />
          <div className="project-info">
            <h3>Nombre del Proyecto</h3>
            <p>Descripción breve...</p>
          </div>
        </div>
      </section>

      {/* Sección "Habilidades" con scroll horizontal */}
      <section id="skills" className="section">
        <h2>Habilidades</h2>
        <div className="skills-scroll">
          {['html', 'css', 'js', 'react', 'node'].map((skill) => (
            <img 
              key={skill} 
              src={`/${skill}-logo.png`} 
              alt={skill} 
              className="skill-logo"
            />
          ))}
        </div>
      </section>

      {/* Sección "Contacto" (pendiente) */}
      <section id="contact" className="section">
        <h2>Contacto</h2>
      </section>
    </div>
  );
}

export default App;
